(select yh.user_ID from t_xt_yh yh where yh.user_ID=t.FHR) FHRDM,(select yh.XM from t_xt_yh yh where yh.user_ID=t.FHR) FHR,date_format(T.FHRQ,'%Y-%c-%d') FHRQ,IFNULL(T.KJQJ,SQ.SSSQ) KJQJ
from t_sj_ysj_sjsqd sq,t_dj_qyxx qy LEFT JOIN T_SJ_DG_JDSMJL T ON   t.DJXH=qy.DJXH AND T.LSH=#{LSH} AND T.DG_DM=#{DG_DM} 
WHERE QY.DJXH=#{DJXH} and qy.DJXH=sq.DJXH and sq.lsh=#{LSH}

